import React from 'react'
import "./widgetsm.css"
// import ArrowDownwardIcon from '@material-ui/icons/ArrowDownward';
import ArrowUpwardIcon from '@material-ui/icons/ArrowUpward';

export default function Widgetsm() {
    return (
        <div className="widgetsm">
            <div className="widgrtsmItem">
            <span className="widgrtsmTitle">New Users</span>
                <div className="widgrtsmIdContianer">
                    <span className="widgrtsmId">400K</span>
                    <span className="widgrtsmRate">
                        -3k <ArrowUpward className='widgetsmIcon'/>
                        </span>
                </div>
                <span className="widgrtsmSub">Compared to last 7 days</span>
            <div/> 
            </div>

        </div>
    )
}
